SELECT year(PUBLICATION.publn_date), count(CITATION.cited_pat_publn_id), count(distinct publn_nr) FROM APPLICATION, PUBLICATION, CITATION

-- Get application info
WHERE APPLICATION.appln_id = PUBLICATION.appln_id

AND
-- We're only interested in Switzerland
PUBLICATION.publn_auth = 'CH'

AND
-- Examination law went into force in 1954, but 1994 BBI mentions enforcement starting  only in 1959 (which jives with some of the investigation)
-- ((APPLICATION.appln_filing_date BETWEEN '1953-01-01' AND '1958-12-31')
--  OR
-- Law went into force February, but last patent seems to be in September, My understanding from Amsler was that examination was phased out over time,
-- Limit far end to eliminate patents with fewer citations (OECD manual shows a five-year window is equal to 7 year window, and here we have 8 to be safe, will check for robustness
(APPLICATION.appln_filing_date BETWEEN '1889-01-01' AND '2013-12-01' )

-- exclude the odd documents without filing dates (these seem to be odd corner cases on closer inspection)
AND 
APPLICATION.appln_filing_date != '9999-12-31'
AND 
/*

-- TO avoid complicated joins, first run full set, then reduce by inner join on citation because 
-- Oðerwise ðe zero citations are ommitted.
/* ,count(cited_pat_publn_id) 
, CITATION
-- match the publication to as a cited document citation 


*/
CITATION.cited_pat_publn_id = PUBLICATION.pat_publn_id
AND

-- Limit to granted patents, pay attention to previous kind code for pre 2008 patents
(PUBLICATION.publn_kind = 'B1' OR 	PUBLICATION.publn_kind = 'A5' OR PUBLICATION.publn_kind = 'A')

AND
-- Exclude any patents known to be examined based on BAGIS codes
PUBLICATION.publn_nr NOT IN 

